import './App.css';
import Products from "./components/products"
import { Router , Switch , Route } from 'react-router-dom';
function App() {
    <Router>
        <Switch>
            <Route exact path='/home' component={Products}></Route>
        </Switch>
    </Router>
}
export default App;
